import React, { useEffect } from "react";
import styles from "./ContactUs.module.scss";
import svs from "../../../../assets/blogImages/svslogo.jpg";
import teamslogo from "../../../../assets/blogImages/team9logo.jpg";
import bhonchesaraLogo from "../../../../assets/blogImages/bhonchesara.webp";
import "bootstrap/dist/css/bootstrap.min.css";
import ContactUsForm from "../../../forms/ContactUsForm";

const ContactUs = () => {
  useEffect(() => {
    // Show cards with delay
    const showCards = () => {
      setTimeout(() => {
        document.getElementById("card1").style.opacity = "1";
        document.getElementById("card1").style.transform = "translateY(0)";
      }, 500);

      setTimeout(() => {
        document.getElementById("card2").style.opacity = "1";
        document.getElementById("card2").style.transform = "translateY(0)";
      }, 1000);

      setTimeout(() => {
        document.getElementById("card3").style.opacity = "1";
        document.getElementById("card3").style.transform = "translateY(0)";
      }, 1500);
    };

    showCards();
  }, []);

  return (
    <>
      <div>
        <div>
          <h1 className={styles.helpSection}>
            How can we help you?
            <button
              className={styles.contactButton}
              data-bs-toggle="modal"
              data-bs-target="#contactModal"
              aria-labelledby="contactModalLabel"
            >
              Contact Us
            </button>
          </h1>
        </div>

        {/* Modal */}
        <div
          className="modal fade"
          id="contactModal"
          tabIndex="-1"
          role="dialog"
          aria-labelledby="contactModalLabel"
          aria-hidden="true"
        >
          <div
            className="modal-dialog modal-dialog-scrollable"
            role="document"
            style={{ position: "fixed", top: "10%", right: "10%", width: "300px" }}
          >
            <div className="modal-content">
              <div className="modal-header">
                <h5 className="modal-title" id="contactModalLabel">
                  Contact Us
                </h5>
                <button
                  type="button"
                  className="btn-close"
                  data-bs-dismiss="modal"
                  aria-label="Close"
                ></button>
              </div>
              <div className="modal-body">
                <ContactUsForm />
              </div>
            </div>
          </div>
        </div>
      </div>

      {/* Rest of the ContactUs component */}
      <div style={{ backgroundColor: "#f0f1f2" }}>
        <div className="container mt-5">
          <div className="row justify-content-center">
            <div
              className="container text-center d-flex flex-column align-items-center justify-content-center"
              style={{ marginTop: 30 }}
            >
              <h1 className={styles.sectionHeader}>We Are Looking for</h1>
              <h6
                className=" px-3 mt-2"
                style={{ fontFamily: "system-ui", color: "black" }}
              >
                We are happy to assist you in providing comprehensive services, a
                dedicated team of professionals who are committed to going the extra
                mile for you, around the clock, to enhance your experience with
                unwavering efficiency.
              </h6>
            </div>

            <div className="col-md-4 mb-4 mt-4" style={{ backgroundColor: "white" }}>
              <div
                className={`d-flex flex-column align-items-center justify-content-center p-4 shadow rounded-lg ${styles.projectCard}`}
                id="card1"
              >
                <h6 className={styles.projectName}>Sri SVS Pearls & Jewellers</h6>
                <img
                  className="img-fluid"
                  src={svs}
                  alt="Sri SVS Pearls & Jewellers"
                />
              </div>
            </div>
            <div className="col-md-4 mb-4 mt-4" style={{ backgroundColor: "white" }}>
              <div
                className={`d-flex flex-column align-items-center justify-content-center p-4 shadow rounded-lg ${styles.projectCard}`}
                id="card2"
              >
                <h6 className={styles.projectName}>Bhonchesara</h6>
                <img className="img-fluid" src={bhonchesaraLogo} alt="Bhonchesara" />
              </div>
            </div>
            <div className="col-md-4 mb-4 mt-4" style={{ backgroundColor: "white" }}>
              <div
                className={`d-flex flex-column align-items-center justify-content-center p-4 shadow rounded-lg ${styles.projectCard}`}
                id="card3"
              >
                <h6 className={styles.projectName}>Team 9 Infra</h6>
                <img className="img-fluid" src={teamslogo} alt="Team 9 Infra" />
              </div>
            </div>
          </div>
        </div>

        <div>
          <h1 className={styles.locationText}>Location</h1>
          <div className={`container shadow ${styles.locationContainer}`}>
            <div className="row">
              <div className="col-md-6 d-flex justify-content-center align-items-center">
                <img
                  src="https://thumbs.dreamstime.com/b/famous-hyderabad-landmark-charminar-india-world-built-quli-qutb-shah-th-century-128124667.jpg"
                  alt="Charminar"
                  className={styles.locationImg}
                  style={{ width: "70%", height: "70%" }}
                />
              </div>
              <div className="col-md-6 d-flex flex-column justify-content-center align-items-center">
                <h2
                  style={{
                    textAlign: "center",
                    marginBottom: "20px",
                    marginLeft: -30,
                    fontFamily: "system-ui",
                  }}
                >
                  TRISHOKA DIGITAL SERVICES
                </h2>
                <u>
                  <p
                    style={{
                      textAlign: "center",
                      color: "#B87333",
                      fontFamily: "system-ui",
                    }}
                  >
                    Off. No: 1014, 10th Floor, Prajay Princeton Towers, Saroornagar,
                    Doctors Colony, Opp NTR Market, L.B. Nagar, Hyderabad - 500074
                  </p>
                </u>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default ContactUs;
